import React from 'react'
import Navbar from '../components/Navbar'
import Footer from '../components/Footer'
import Banner from '../components/Banner'
import CarCard from '../components/CarCard'
import NavbarLoggedIn from '../components/NavbarLoggedin'
import FooterLoggedIn from '../components/FooterLoggedIn'
import { makeStyles } from '@material-ui/core/styles';
import MenuItem from '@material-ui/core/MenuItem';
import FormHelperText from '@material-ui/core/FormHelperText';
import FormControl from '@material-ui/core/FormControl';
import { withStyles } from '@material-ui/core/styles';
import Select from '@material-ui/core/Select';

const OurModels = () => {

    var AuthNavbar = '';
    var AuthFooter = '';

if(localStorage.getItem('auth_token'))

{

    AuthNavbar = (
     <NavbarLoggedIn/>
                );

    AuthFooter = (
     <FooterLoggedIn/>
                );


} else {

  AuthNavbar = (
     <Navbar/>
                );

    AuthFooter = (
     <Footer/>
                );            

    
}


const StyledSelect = withStyles({
  root: {
    background: '#171717',
    borderRadius: 3,
    border: 0,
    color: 'white',
    height: '20px',
    padding: '0 30px',
    boxShadow: '0 3px 5px 2px rgba(255, 105, 135, .3)',
  },
  label: {
    textTransform: 'capitalize',
  },
})(Select);










const useStyles = makeStyles((theme) => ({
  formControl: {
    margin: theme.spacing(1),
    minWidth: 120,
  },
  selectEmpty: {
    marginTop: theme.spacing(2),
  },
}));



const classes = useStyles();
  const [age, setAge] = React.useState('');

  const handleChange = (event) => {
    setAge(event.target.value);
  };



  return (
    <div>
      <div className="empty_space"></div>
      {AuthNavbar}
      <Banner title="Modelljeink" />

      <div className="filter_container">
        <form>

      <FormControl className={classes.formControl}>
        <StyledSelect
          value={age}
          onChange={handleChange}
          displayEmpty
          className={classes.selectEmpty}
          inputProps={{ 'aria-label': 'Without label' }}
        >
          <MenuItem value="" disabled>
          Kategória
          </MenuItem>
          <MenuItem value={10}>Sedan</MenuItem>
          <MenuItem value={20}>Hibrid</MenuItem>
          <MenuItem value={30}>Furgon</MenuItem>
          <MenuItem value={30}>Kombi</MenuItem>
        </StyledSelect>
        <FormHelperText>Válasszon kategóriát!</FormHelperText>
      </FormControl>




      </form>
      
      </div>


      <div className="car_card_container">
      <CarCard />
      <CarCard />
      <CarCard />
      </div>



      {AuthFooter}


    </div>
  )
}

export default OurModels
